package com.zgw.apimember.controller;

import com.netflix.hystrix.contrib.javanica.annotation.HystrixCommand;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.stereotype.Controller;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.ResponseBody;
import org.springframework.web.client.RestTemplate;

import javax.servlet.http.HttpServletRequest;
import java.util.List;

/**
 * @author 忘忧症
 * @Distribute
 */


@Controller
public class ProblemController {



    @Autowired
    RestTemplate restTemplate;

    @RequestMapping("/hello")
    public String hello(){

        String url="http://service-file/get";
        restTemplate.postForEntity(url,"",String.class);

        System.out.println("=====");
        return "index";
    }


    @RequestMapping(value = "/testHystrix")
    @HystrixCommand(fallbackMethod = "helloFallback",commandKey = "queryAllKey")//熔断器指定操作的方法
    public Object queryAll(){
        System.out.println("==========进入访问方法============");
        String url="aaa";
        List forObject = restTemplate.getForObject(url+"/queryAll", List.class);
        return forObject;
    }

    private Object helloFallback(){
        return null;
    }

    @RequestMapping("/demo")
    public String demo(){
        System.out.println("=====");
        return "index";
    }




    @ResponseBody
    @RequestMapping("/demo1")
    public String demo1(){

       return "<h1>欢迎使用 wangEditor 富文本编辑器<img src=\"data:image/jpeg;base64,\" style=\"max-width: 100%;\"></h1><p><br></p><p>146546</p><p><br></p>\n";
    }
    @ResponseBody
    @RequestMapping("/upload")
    public String upload(HttpServletRequest request){
        String html = request.getParameter("html");

        System.out.println(html);
        System.out.println("=====");
        return "index";
    }
}
